import React from 'react';
import { Link } from 'react-scroll';

import '../styling/footer.css';

const Footer = props => (
    <footer id="footer">
        <small>&copy; Copyright 2020, Vadim Stakhnyuk</small>
        <div class="backtotop">
            <div class="backtotop-morph">
                <Link />
            </div>
        </div>
    </footer>
)

export default Footer;
